//react패키지에서 리액트 가져온다.
import React from "react";
import "./style.css";
import {useHistory} from "react-router-dom";


const Weeks = (props) => {

    const history = useHistory();

    //const day = document.getElementsByClassName("weeks-list")
    let day = ["일", "월", "화", "수", "목"]



    // function a() {
    //     return <div></div>

    // }

    // console.log(a())

    return (
        <div>
            {(day.map((e, i)=>{
                return <div>{e, i}</div>

            }))}


            <div className="weeks-list">일
                <div id="circle"></div>
                <div id="circle"></div>
                <div id="circle"></div>
                <div id="circle"></div>
                <div id="circle"></div>
                <div id="arrow" onClick={() => {
                    history.push("./StarPage");
                }}></div>
            </div>

            <div className="weeks-list">월
                <div id="circle"></div>
                <div id="circle"></div>
                <div id="circle"></div>
                <div id="circle"></div>
                <div id="circle"></div>
                <div id="arrow" onClick={() => {
                    history.push("./StarPage");
                }}></div>
            </div>

            <div className="weeks-list">화
                <div id="circle"></div>
                <div id="circle"></div>
                <div id="circle"></div>
                <div id="circle"></div>
                <div id="circle"></div>
                <div id="arrow" onClick={() => {
                    history.push("./StarPage");
                }}></div>
            </div>

            <div className="weeks-list">수
                <div id="circle"></div>
                <div id="circle"></div>
                <div id="circle"></div>
                <div id="circle"></div>
                <div id="circle"></div>
                <div id="arrow" onClick={() => {
                    history.push("./StarPage");
                }}></div>
            </div>

            <div className="weeks-list">목
                <div id="circle"></div>
                <div id="circle"></div>
                <div id="circle"></div>
                <div id="circle"></div>
                <div id="circle"></div>
                <div id="arrow" onClick={() => {
                    history.push("./StarPage");
                }}></div>
            </div>

            <div className="weeks-list">금
                <div id="circle"></div>
                <div id="circle"></div>
                <div id="circle"></div>
                <div id="circle"></div>
                <div id="circle"></div>
                <div id="arrow" onClick={() => {
                    history.push("./StarPage");
                }}></div>
            </div>

            <div className="weeks-list">토
                <div id="circle"></div>
                <div id="circle"></div>
                <div id="circle"></div>
                <div id="circle"></div>
                <div id="circle"></div>
                <div id="arrow" onClick={() => {
                    history.push("./StarPage");
                }}></div>
            </div>
        </div>
    );
}


//만든 컴포넌트를 다른 파이에서도 불러다가 쓸 수 있도록 export해줌!
export default Weeks;
